import { useState } from "react";
import { Link, useHistory } from "react-router-dom";
import {
  FiPower,
  FiEdit,
  FiTrash2,
  FiArrowRightCircle,
  FiArrowLeftCircle,
} from "react-icons/fi";
import { Table } from "react-bootstrap";
import logoImage from "../../assets/images/builder.svg";
import "./styles.css";
import api from "../../services/api";

interface iProprietarios{
    codigo: number;
    nome: string;
    email: string;
    cpf: string;
}

const Proprietarios: React.FC = () => {
  const [proprietarios, setProprietarios] = useState<iProprietarios[]>([]);
  const [page, setPage] = useState(0);

  const username = localStorage.getItem('username');
  const token = localStorage.getItem('token')

  const history = useHistory()

  async function lodProprietarios(){
      const response = await api.get('v1/gto/proprietarios');
  }

  return (
    <div className="proprietario-container">
      <header>
        <img src={logoImage} alt="Gestão de Obras" />
        <span>
          Bem-vindo, <strong>{"NOME"}</strong>!
        </span>
        <div className="subheader">
          <button type="button">
            <FiArrowLeftCircle size={18} color="#251FC5" />
          </button>
          <Link className="button" to="/proprietario/0">
            Novo Proprietario!
          </Link>
          <button type="button">
            <FiArrowRightCircle size={18} color="#251FC5" />
          </button>
          <button type="button">
            <FiPower size={18} color="#251FC5" />
          </button>
        </div>
      </header>

      <h1>Proprietários Cadastrados</h1>

      <Table striped bordered hover className="text-center">
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>E-mail</th>
            <th>CPF</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {
            <tr>
              <td>Valor 1</td>
              <td>Valor 2</td>
              <td>Valor 3</td>
              <td>Valor 4</td>
              <td>
                <button type="button">
                  <FiEdit size={20} color="#251FC5" />
                </button>

                <button type="button">
                  <FiTrash2 size={20} color="#251FC5" />
                </button>
              </td>
            </tr>
          }
        </tbody>
      </Table>
    </div>
  );
};
export default Proprietarios;
